import React from 'react';
import Avatar from '@mui/material/Avatar';

import './Sidebar.css';

const Sidebar = () => {
  const recentItem = (topic) => {
    return (
      <div className='sidebar__recentItem'>
        <span className='sidebar__hash'>#</span>
        <p>{topic}</p>
      </div>
    );
  };

  return (
    <div className='Sidebar'>
      <div className='sidebar__top'>
        <img src='https://images.unsplash.com/photo-1529333242387-8c6c002a52d3?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80' />

        <Avatar src='https://assets.gqindia.com/photos/5ee0a65562970f1a2bdba80c/master/w_1600%2Cc_limit/Kawasaki%252520Ninja%252520H2R.jpg'>
          A
        </Avatar>

        <h2>Divye Gupta</h2>
        <h4>divyegupta@gmail.com</h4>
      </div>
      <div className='sidebar__stats'>
        <div className='sidebar__stat'>
          <p>People who viewed you</p>
          <p className='sidebar__statNumber'>3000</p>
        </div>

        <div className='sidebar__stat'>
          <p>Views on posts</p>
          <p className='sidebar__statNumber'>6969</p>
        </div>
      </div>

      <div className='sidebar__bottom'>
        <p>Recent</p>
        {recentItem('abcd')}
        {recentItem('Kota JEE')}
        {recentItem('Iphone13 kidney')}
        {recentItem('Delhi ke Momos')}
        {recentItem('Uttam Nagar')}
      </div>
    </div>
  );
};

export default Sidebar;
